  <style>
    body {

    }
    .container {

      border-radius: 18px;

      margin-bottom: 18px;

      padding: 10px 28px;
      background: #ffd1ca;
      color: #b48e6a;
      border-radius: 6px;
      text-decoration: none;
      font-size: 1rem;
      margin-top: 12px;
      transition: background 0.2s;
    }
    .btn:hover {
      background: #fdb3a7;
      color: #843927;
    }
    .right {
      flex: 1;
      display: flex;
      align-items: center;
      justify-content: center;
      background: none;
    }
    .right img {
      max-width: 100%;
      max-height: 60vh;
      border-radius: 12px;
    }
    @media (max-width: 700px) {
      .container {
        flex-direction: column;
        width: 98vw;
        min-height: unset;
      }
      .right, .left {
        padding: 24px 12px;
      }
      .right img {
        max-height: 30vh;
      }
    }
